measurements.description:
Twenty-seven flowers and 15 buds on 13 up to 6.5-cm inflorescences
 arising from the leaf axils;
 25-cm wide by 36-cm tall plant mounted on a
 13-cm wide by 19-cm tall cork slab;
 sepals and petals light chartreuse;
 dorsal sepal lanceolate, hooded;
 lateral sepals lanceolate, porrect;
 petals spatulate;
 lip trilobed, adnate to column, white, magenta spots proximally,
 callus maroon;
 column light chartreuse adaxially, 
white abaxially, horns white, magenta distally, anther cap white;
 substance firm; texture matte.
